class Footer extends Component {
    render() {
        return (
            <div>
                <footer>
                    <div className="container">
                        <p> User Management Project Â© 2019 All Rights Reserved - Developed by Kai Tran</p>
                        <ul className="list-inline">
                            <li className="list-inline-item">
                                <a href="/">Privacy</a>
                            </li>
                            <li className="list-inline-item">
